	for (let i = 0; i < amount; i++) {
		AvatarArr.push(<Avatar></Avatar>);
	}
	return (
		<div>
			{AvatarArr.map((i, a) => {
				console.log(i);
				return <div key={a}>{a}</div>;
			})}
		</div>
	);
}
